 monthly billing period.", "unLocalized": "", "def": "A lassított sebességű folytatást választottad, így néhány alkalmazás és a böngészés korlátozottan lesz elérhető. Netinfo alkalmazásban bármikor választhatsz a kiegészítő adatcsomagok közül annak érdekében, hogy számlazárásig az eredeti feltételekkel internetezhess.", "hun": "A lassított sebességű folytatást választottad, így néhány alkalmazás és a böngészés korlátozottan lesz elérhető. Netinfo alkalmazásban bármikor választhatsz a kiegészítő adatcsomagok közül annak érdekében, hogy számlazárásig az eredeti feltételekkel internetezhess."}, "Name": {"eng": "Go", "unLocalized": "", "def": "Go", "hun": "Go"}, "Warning_text": {"eng": "You have used 80% of your mobile internet allowance. When you reach 100%, you will need an extra data pack to continue using mobile internet at full speed before the start of your next bill cycle. You can even choose a great value extra data pack now - before you run out!", "unLocalized": "", "def": "A csomagodban foglalt belföldi adatmennyiség 80%-át elhasználtad. Ha eléred a 100%-ot, annak érdekében, hogy számlazárásig változatlan feltételekkel internetezhess, válassz az alábbi kiegészítő adatcsomagok közül.", "hun": "A csomagodban foglalt belföldi adatmennyiség 80%-át elhasználtad. Ha eléred a 100%-ot, annak érdekében, hogy számlazárásig változatlan feltételekkel internetezhess, válassz az alábbi kiegészítő adatcsomagok közül."}, "UnlimitedContentPackages": ["UCP67695", "UCP67694", "UCP67693", "UCP67696"], "Upgrade_offer_ids": [], "Featured": "false", "Price": "0", "Throttling_limit_mb": "150", "Type": "IOYM", "Warning_percent": "80", "Continue_with_throttling": "true", "Id": "56383", "Online_selfcare_id": "", "Pool_ids": [], "Active": "false"}', 12);
