INSERT INTO oscc_object VALUES (DEFAULT, '61365', '{"PSMCodes": {"Activation": ""}, "Featured": "false", "Price": "0", "Description": {"eng": "Upload your code in the „Netre Szomjazol?” game and we give 50 MB extra data for domestic use, which can be consumed until this midnight. We are going to send SMS notification, if you run out of it. You can collect max 3x50 MB per day.", "unLocalized": "", "def": "Töltsd fel kódod a „Netre szomjazol?” játékban, és kódonként 50 MB-ot jóváírunk egyenlegeden, melyet ma éjfélig használhatsz fel belföldön. SMS-ben értesítünk, ha promóciós adatforgalmad elfogy, egy nap maximum 3x50 MB-ot gyűjthetsz!", "hun": "Töltsd fel kódod a „Netre szomjazol?” játékban, és kódonként 50 MB-ot jóváírunk egyenlegeden, melyet ma éjfélig használhatsz fel belföldön. SMS-ben értesítünk, ha promóciós adatforgalmad elfogy, egy nap maximum 3x50 MB-ot gyűjthetsz!"}, "Type": "Emergency", "Data_usage_mb": "50", "Name": {"eng": "Netre szomjazol data", "unLocalized": "", "def": "Netre szomjazol adat", "hun": "Netre szomjazol adat"}, "Refill_ids": [], "Id": "61365", "Online_selfcare_id": "", "Active": "false"}', 11);
INSERT INTO oscc_object VALUES (DEFAULT, '61364', '{"PSMCodes": {"Activation": ""}, "Featured": "false", "Price": "0", "Description": {"eng": "1 GB extra data is the monthly prize of the „Netre szomjazol?” game, which is for domestic use and can be consumed in 30 days or until the next billing cycle after the activation. We are going to send SMS notification, if you run out of it.", "unLocalized": "", "def": "A „Netre szomjazol?” játékban heti nyereményed 1GB adatforgalom, mely 30 napig, illetve nyeremény aktiválását követő számlázási ciklus végéig használható fel belföldön.", "hun": "A „Netre szomjazol?” játékban heti nyereményed 1GB adatforgalom, mely 30 napig, illetve nyeremény aktiválását követő számlázási ciklus végéig használható fel belföldön."}, "Type": "Multicycle", "Data_usage_mb": "1024", "Name": {"eng": "Netre szomjazol 1 GB", "unLocalized": "", "def": "Netre szomjazol 1 GB ", "hun": "Netre szomjazol 1 GB "}, "Refill_ids": [], "Id": "61364", "Online_selfcare_id": "", "Active": "false"}', 11);
