INSERT INTO oscc_object VALUES (DEFAULT, '60859', '{"PSMCodes": {"Deactivation": "XEXTRA5GB-M", "Activation": "EXTRA5GB-M"}, "Featured": "false", "Price": "2832", "Description": {"eng": "This extra data pack will give you additional 5GB of mobile internet (on top of the data already included in your tariff) for 2832 Ft. It will be activated every month at the start of your billing period so you don''t have to worry about purchasing extra data every month - after you run out! You can cancel this extra data pack at any time.", "unLocalized": "", "def": "Válaszd ezt az adatopciót és növeld meg a tarifádban foglalt adatkeretedet 5 GB-tal, amit egészen számlazárásig felhasználhatsz. Ez az adatopció minden hónapban automatikusan megújul, így nem kell havonta újra megrendelned és bármikor lemondhatod. Az opció ára 2832 Ft.", "hun": "Válaszd ezt az adatopciót és növeld meg a tarifádban foglalt adatkeretedet 5 GB-tal, amit egészen számlazárásig felhasználhatsz. Ez az adatopció minden hónapban automatikusan megújul, így nem kell havonta újra megrendelned és bármikor lemondhatod. Az opció ára 2832 Ft."}, "Type": "Recurring", "Data_usage_mb": "5120", "Name": {"eng": "5 GB ExtraAdat (Recurring)", "unLocalized": "", "def": "5 GB ExtraAdat (Megújuló)", "hun": "5 GB ExtraAdat (Megújuló)"}, "Refill_ids": [], "Id": "60859", "Online_selfcare_id": "", "Active": "true"}', 11);
