INSERT INTO oscc_object VALUES (DEFAULT, '61889', '{"PSMCodes": {"Deactivation": "", "Activation": ""}, "Featured": "true", "Price": "0", "Description": {"eng": "This extra data pack will give you an additional 4 GB of mobile internet until the end of your next 3 bill cycles.", "unLocalized": "", "def": "A +4GB díjmentes adatopció 4GB adatkeretet biztosít, mely a tarifában foglalt adaton felül értendő és azonos feltételekkel, az aktiválástól számított 3 számlázási cikluson belül használható fel díjmentesen, nem megosztható. Az adatopció aktiválása során Előfizető vagy Felhasználó hozzájárul ahhoz, hogy a szerződéskötéskor megadott személyes adataikat (név, telefonszám, e-mail és postai cím) a Vodafone saját marketing tevékenységéhez, közvetlen üzletszerzés, piackutatás és tájékoztatás céljára telefonon vagy egyéb elektronikus hírközlési úton (pl. SMS, MMS, e-mail), automatizált hívórendszeren keresztül, illetve postai úton felhasználja. Fenti hozzájárulás bármikor korlátozás és indokolás nélkül, ingyenesen visszavonható a Vodafone Magyarország Zrt. 1476 Budapest, Pf.: 350. postai és az ugyfelszolgalat.hu@vodafone.com elektronikus címeken keresztül. http://www.vodafone.hu/adatkezelesi-tajekoztato/adatkezeles-4gb.pdf", "hun": "A +4GB díjmentes adatopció 4GB adatkeretet biztosít, mely a tarifában foglalt adaton felül értendő és azonos feltételekkel, az aktiválástól számított 3 számlázási cikluson belül használható fel díjmentesen, nem megosztható. Az adatopció aktiválása során Előfizető vagy Felhasználó hozzájárul ahhoz, hogy a szerződéskötéskor megadott személyes adataikat (név, telefonszám, e-mail és postai cím) a Vodafone saját marketing tevékenységéhez, közvetlen üzletszerzés, piackutatás és tájékoztatás céljára telefonon vagy egyéb elektronikus hírközlési úton (pl. SMS, MMS, e-mail), automatizált hívórendszeren keresztül, illetve postai úton felhasználja. Fenti hozzájárulás bármikor korlátozás és indokolás nélkül, ingyenesen visszavonható a Vodafone Magyarország Z