ed, amíg rendelkezel minimális adattal. A Video Pass belföldön és az EU-n belül érhető el, meghatározott applikációkra, személyi használatra, utazási célra, a tarifában foglalt vagy vásárolt kiegészítő adatopció erejéig. A Video Pass automatikusan megújul minden hónapban,így nem kell havonta újrarendelned. A Video Pass a video szolgáltatást nyújtó harmadik fél által havidíj ellenében elérhető prémium funkcióik elérését nem tartalmazza, ezen fizetős tartalmak igénybevételéhez külön előfizetés szükséges a video szolgáltatónál. "}, "Name": {"eng": "Video Pass", "unLocalized": "", "def": "Video Pass", "hun": "Video Pass"}, "Id": "UCP67693", "Active": "true"}', 6);
