INSERT INTO oscc_object VALUES (DEFAULT, '10027DR4RPData', '{"Active": "true", "VFPLAN": "PRE", "Name": {"unLocalized": "", "hun": "Európa Adat Napijegy", "eng": "EU Daily Data Ticket", "def": "Európa Adat Napijegy"}, "Upgrade_offer_ids": [], "Warning_text": {"unLocalized": "", "hun": "Felhasználtad az Európa Adat Napijegy opció forgalmi keretének 80%-át. Vodafone", "eng": "You have reached 80% of your Europe Daily Data ticket data allowance. Vodafone", "def": "Felhasználtad az Európa Adat Napijegy opció forgalmi keretének 80%-át. Vodafone"}, "Throttling_limit_mb": "100", "Discount_counter_direction": "down", "Id": "10027DR4RPData", "Description": {"unLocalized": "", "hun": "Internetezz külföldön is! Rendelj Európa adat napijegyet 919Ft-ért! A napijegy 100 MB adatforgalmat tartalmaz, amit aznap magyarországi idő szerint éjfélig használhatsz fel! Felhívjuk figyelmedet, hogy az Európa adat napijegy Netjeggyel nem vehető igénybe!", "eng": "As a pay as you go customer, you can enjoy 100 Megabytes of Data, when roaming anywhere in Europe, for only 919 Hungarian forints per day with EU Daily Data ticket. Please be aware that the EU Daily Data ticket cannot be used with Netjegy!", "def": "Internetezz külföldön is! Rendelj Európa adat napijegyet 919Ft-ért! A napijegy 100 MB adatforgalmat tartalmaz, amit aznap magyarországi idő szerint éjfélig használhatsz fel! Felhívjuk figyelmedet, hogy az Európa adat napijegy Netjeggyel nem vehető igénybe!"}, "PSMCodes": {"Activation": "ADATNAPI", "Status": "SADATNAPI"}, "Price": "919", "Throttling_Accepted_Text": {"unLocalized": "", "hun": "", "eng": "", "def": ""}, "Throttling_text": {"unLocalized": "", "hun": "Felhasználtad az Európa Adat Napijegy opció adatforgalmi keretét. A felhasználást követően a forgalmi díjas árazás (60Ft/100kB) érvényes. Vodafone", "eng": "You have used all your Europe Daily Data ticket data allowance. For further data usage 60Ft/100kB rates applies. Vodafone", "def": "Felhasználtad az Európa Adat Napijegy opció adatforgalmi keretét. A felhasználást követően a forgalmi díjas árazás (60Ft/100kB) érvényes. Vodafone"}, "Type": "ROAMING", "Warning_percent": "80"}', 4);
