INSERT INTO oscc_object VALUES (DEFAULT, '51747Dra500m1m', '{"Active": "false", "VFPLAN": "BOTH", "Name": {"unLocalized": "", "hun": "Internet Külföldön Opció", "eng": "Internet Külföldön option", "def": "Internet Külföldön Opció"}, "Upgrade_offer_ids": [], "Warning_text": {"unLocalized": "", "hun": "Felhasználtad az Internet Külföldön opció havi kedvezményes forgalmi keretének (500MB) 80%-át. Vodafone", "eng": "You have used up 80% of your discounted monthly Internet Abroad option (500 MB). Vodafone", "def": "Felhasználtad az Internet Külföldön opció havi kedvezményes forgalmi keretének (500MB) 80%-át. Vodafone"}, "Throttling_limit_mb": "500", "Discount_counter_direction": "down", "Id": "51747Dra500m1m", "Description": {"unLocalized": "", "hun": "Minden hónapban 1 GB adatmennyiség áll rendelkezésedre az Internet Külföldön Opcióval!", "eng": "The Internet Külföldön Option offers you 1 GB data traffic limit every month.", "def": "Minden hónapban 1 GB adatmennyiség áll rendelkezésedre az Internet Külföldön Opcióval!"}, "Price": "5101", "Throttling_Accepted_Text": {"unLocalized": "", "hun": "", "eng": "", "def": ""}, "Throttling_text": {"unLocalized": "", "hun": "Felhasználtad az Internet Külföldön opció havi forgalmi keretét (500MB). Hó végéig 60Ft/100kB-os forgalmi díjas árazás érvényes. Vodafone", "eng": "You have used up your discounted monthly Internet Abroad option (500 MB). Normal charges of 60 Ft/100kB apply to the end of the month. Vodafone", "def": "Felhasználtad az Internet Külföldön opció havi forgalmi keretét (500MB). Hó végéig 60Ft/100kB-os forgalmi díjas árazás érvényes. Vodafone"}, "Type": "ROAMING", "Warning_percent": "80"}', 4);
